import 'bootstrap/dist/css/bootstrap.min.css';
import { useState } from 'react';
import './App.css';
import { CartProvider } from './context/cartContext';
import Routes from './routes/routes';

function App() {
  const [products, setProducts] = useState(null);

  return <div id="app">
  <CartProvider>
    <Routes />
  </CartProvider>
  </div>
}

export default App;
